CREATE TABLE `paises` (
  `ID_pais` varchar(4) NOT NULL,
  `Pais` varchar(60) NOT NULL,
  `ID_continente` varchar(4) NOT NULL,
  `Region` varchar(40) NOT NULL,
  `Area` varchar(9) NOT NULL,
  `Independencia` int(5) DEFAULT NULL,
  `Poblacion_nacional` varchar(11) NOT NULL,
  `Expectativa_vida` float(3,1) DEFAULT NULL,
  `PIB_actual` varchar(10) NOT NULL,
  `PIB_antiguo` varchar(10) DEFAULT NULL,
  `Nombre_local` varchar(50) DEFAULT NULL,
  `ID_gobierno` int(3) NOT NULL,
  `Jefe_gob` varchar(45) DEFAULT NULL,
  `Cod_2` char(2) NOT NULL,
  `Comida` varchar(35) DEFAULT NULL,
  `Religion` varchar(25) DEFAULT NULL,
  `Bandera` varchar(200) DEFAULT NULL,
  PRIMARY KEY (`ID_pais`),
  KEY `ID_continente` (`ID_continente`),
  KEY `ID_gobierno` (`ID_gobierno`),
  CONSTRAINT `paises_ibfk_1` FOREIGN KEY (`ID_continente`) REFERENCES `continentes` (`ID_continente`),
  CONSTRAINT `paises_ibfk_2` FOREIGN KEY (`ID_gobierno`) REFERENCES `gobiernos` (`ID_gobierno`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
